from dbbase import MusicDBRootDataIOfrom dbparse import MusicDBGroupDataIOfrom musicdb.albumoftheyear import MusicDBParamsfrom musicdb.albumoftheyear import MediaSummaryProducerIOdef test_mediasumprod():    params = MusicDBParams()    rdio = MusicDBRootDataIO(db=params.db, verbose=True)    gdio = MusicDBGroupDataIO(rdio, params, verbose=True)    gdio.addGroupData()    medsumprodio = MediaSummaryProducerIO(rdio, verbose=True)    medsumprodio.make(test=True)    if __name__ == "__main__":    test_mediasumprod()    